$csvData = Import-Csv $SessionListFile -Header A,B
$ListBoxSessions.DisplayMember = 'A'

#-- Filter Sessions Function
function FilterListBox {
    $ListBoxSessions.Items.Clear();

    if (!$TextBoxFilter.TextLength -eq 0) {
        foreach ($str in $csvData) {
            if ($str -match $TextBoxFilter.Text) {
                $ListBoxSessions.Items.Add($str);
            }
        }
    }
    else {
        foreach($item in $csvData) { 
                $ListBoxSessions.Items.Add($item)
        }
    }
}
#-- Initial Session List Loading
FilterListBox | Out-Null

function UpdateHostname {
    $TextBoxHostnameConnect.Text = $ListBoxSessions.SelectedItem.B
    $TextBoxHostnamePing.Text = $ListBoxSessions.SelectedItem.B
}

function UpdateLogFile {
    $LogTime = get-date -format yyyy-MM-dd_HHmm-ssfff
    #-- Log Time Format
    $LogFile = $LoggingFolder + "\" + $prependLogFileName + "-" + $LogTime + ".txt"
    return $LogFile
}

#-- Apply images to buttons
$a = 1 
Do {
    $SettingButton = $((Get-Variable -Name "SettingButton$a").Value)
    $base64ImageString = $((Get-Variable -Name "base64$SettingButton").Value)
    $imageBytes = [Convert]::FromBase64String($base64ImageString)
    $ms = New-Object IO.MemoryStream($imageBytes, 0, $imageBytes.Length)
