} While ($a -le 24)



#--- Interactive Functions

#--- HTTPS
function ConnectHTTPS {
    $File = "https://"+$TextBoxHostnameConnect.Text
    Start-Process $File
}

#--- SSH
function ConnectSSH {
    $prependLogFileName = "SSH-" + $TextBoxHostnameConnect.Text
    $LogFile = UpdateLogFile
    
    if ("".Equals($TextBoxUsername.Text)) {
        $File = $SettingSecureCrtPath
        $Arguments = " /LOG `"" + $LogFile + "`" /T /SSH2 /ACCEPTHOSTKEYS /AUTH keyboard-interactive " + $TextBoxHostnameConnect.Text
        Start-Process $File $Arguments
        #Write-Host $File $Arguments
    } else {
        $File = $SettingSecureCrtPath
        $Arguments = " /LOG `"" + $LogFile + "`" /T /SSH2 /ACCEPTHOSTKEYS /AUTH keyboard-interactive " + $TextBoxHostnameConnect.Text  + " /L " + $TextBoxUsername.Text + " /PASSWORD `"" + $MaskedTextBox.Text + "`"  "
        Start-Process $File $Arguments
        #Write-Host $File $Arguments
    }
}

