    $LogFile = UpdateLogFile

    $File = $SettingSecureCrtPath
    $Arguments = " /LOG `"" + $LogFile + "`" /T /SERIAL " + $ComboBoxCOM.Text + " /BAUD " + $ComboBoxBAUD.Text
    Start-Process $File $Arguments
    #Write-Host $File $Arguments
}

#--- Ping
function ExecutePing {
    $prependLogFileName = "Ping" + "-" + $TextBoxHostnamePing.Text
    $LogFile = UpdateLogFile

    #-- DNS?
    $StringPingDNS = ""
    if ( $CheckBoxDNS.Checked -eq $true ) {
        $StringPingDNS = "-a"
    } else {
        $StringPingDNS = ""
    }

    $File = "powershell.exe"
    $Arguments = "-ExecutionPolicy Bypass -noexit -Command `"`$host.ui.RawUI.WindowTitle = 'Pinging " + $TextBoxHostnamePing.Text + "' ; ping -t " + $StringPingDNS + " " + $TextBoxHostnamePing.Text + " 2>&1 |Foreach{'{0} - {1}' -f (Get-Date -f yyyy-MM-dd_HHmm-ssfff),`$_} | select -skip 1 | Tee-Object `"" + $LogFile + "  `""
    Start-Process $File $Arguments

}

#--- COM List
function COMList {
    $File = "powershell.exe"
    $Arguments = "-command `"change port /query; pause`""
    Start-Process $File $Arguments
}

